const Massages = () => {
    return (
      <div className="Massages">
        <div className="Textmassages">
        <h3>Comme se déroule un rendez-vous :</h3>
        <p>Je me déplace avec ma table de massage ainsi que tout le nécessaire pour la préstation (serviettes, musiques,huiles..).</p>
        <p>Nous pouvons nous installer dans votre salon, sur votre terrasse ou encore dans votre jardin si la météo le permet.</p>
        <p>Avant le début de chaque prestation, nous prenons le temps d'évaluer ensemble le type de pression que vous souhaitez, l'ajout d'huiles essentielles ou non, le type de musique..</p>
        <h3>Tous les soins sont personnalisables, à l'exception de Lomi Lomi.</h3>
        <p>Afin que cette parenthèse de bien-être soit complète, les massages proposés ont une durée minimum de 30 minutes.</p>
        <p>N'hésitez pas à me contacter pour des évènements particuliers (EVJF, anniversaire, baby shower...).</p>
        <h3>A très vite !</h3>
        </div>
      </div>
    );
  };
  
  export default Massages;
